import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';
import Login from './Pages/Authentication/Login';
function App() {
  return (
    <Router>
    <Routes>
      <Route path={'/'} element={<Login/>}/>
    </Routes>
      <div>App</div>
    </Router>

  );
}

export default App;
